webpackJsonp([0x868cd633a6dc],{6602:function(e,a){e.exports={data:{post:{html:"<p>German taxpayers will be pleased to learn that they are no longer paying me not to work. My colleague on her arm and is out indefinitely with a compound fracture, so I'm back full time. And I get to fake being a Solaris expert until she comes back. A calendar left in my office by a former co-worker reads 'Guessing right three times makes you an expert.' I've been guessing right so far, even with the RAID for which I had neither a handbook nor a clue.</p>",fields:{title:"I'm An Expert",date:"14 Jan 2004",url:"https://papascott.de/2004-01-14-im-an-expert/"}}},pathContext:{slug:"/2004-01-14-im-an-expert/",prev:{fields:{title:"In German, a young lady has no sex, while a turnip has.",date:"13 Jan 2004",slug:"/2004-01-13-in-german-a-young-lady-has-no-sex-while-a-turnip-has/"}},next:{fields:{title:"Big media meets big blog(g)",date:"15 Jan 2004",slug:"/2004-01-15-big-media-meets-big-blogg/"}}}}}});
